/* global describe it expect */
const { convert } = require('../lib')

const srcData = Buffer.from('', 'base64')
const fixtures = new Map([
  // NOTE: PNG is mutable so it can't be presented as fixture
  ['fit', ''],
  ['fill', ''],
  ['crop', '']
])

describe(('convert raster, format=jpeg'), () => {
  for (const [resize, result] of fixtures) {
    it(`resize=${resize}`, async () => {
      const opts = { format: 'JPEG', width: 200, height: 200, quality: 100 }
      const output = await convert({ ...opts, srcData, resize })

      expect(output.toString('base64')).to.be.equal(result)
    })
  }
})
